import React, { Component } from "react";
import CardNotas from "./CardNotas"

export default class ListaDeNotas extends Component {
    render() {
        return (
            <ul>
                {Array.of}
                <li>
                    <CardNotas/>
                </li>
            </ul>
        )
    }
}
